import React from 'react'
import { useNavigate } from 'react-router-dom';

function Header() {
    let navigate = useNavigate();

    return (
        <div>
            <header>
                <nav>
                    <ul>
                        <li>
                            <a onClick={() => {
                                navigate('/')
                            }} 
                            href='#'>
                                Home
                            </a>
                        </li>
                        <li>
                            <a onClick={() => {
                                navigate('/')
                            }} 
                            href='#'>
                                Portfolio
                            </a>
                        </li>
                        <li>
                            <a onClick={() => {
                                navigate('/')
                            }} 
                            href='#'>
                                About
                            </a>
                        </li>
                        <li>
                            <a onClick={() => {
                                navigate('/')
                            }} 
                            href='#'>
                                Home
                            </a>
                        </li>
                    </ul>
                </nav>
            </header>
        </div>
    );
}

export default Header
